import React from "react";
import emojipedia from "../emojipedia";
import Ret from "./Emoji";

function emojiRender(emojipedia){
  return <Ret emoji={emojipedia.emoji} title={emojipedia.name} />
}

function App() {
  return (
    emojipedia.map()

  );
}

export default App;
